import React from "react";
import "./footer.css";
import { Container, Row, Col } from "react-bootstrap";
const Footer = () => {
  return (
    <Container fluid="md">
      <Row>
        <Col>Explore</Col>
      </Row>
    </Container>
  );
};

export default Footer;
